    if search_term != None:
        url = f"https://html.duckduckgo.com/html/?q={re.sub('[^A-Za-z0-9]+', '+', search_term)}"
        with requests.Session() as session:
            response = session.get(url, proxies=formated_proxy, headers=header, timeout=(30, 90))
